import ResultSummary from "./ResultSummary";
import Search from "./Search";

function ResultStat(props) {
  const breed = props.breed;
  const typeSelect = props.typeSelect;

  // Search 결과 db로부터 받아옴
  const result = Search(breed, typeSelect);

  // 필요없는 데이터 삭제
  delete result.id;
  delete result.breed;

